INSERT INTO `Newstsl` (`nid`, `lng`, `title`, `summary`, `content`, `url`, `seo_keywords`, `seo_title`, `seo_description`, `active`) VALUES
(1, 'nl', 'De wachtlijst in crèche pardijntje wordt uitgebreid met 28 plaatsen', 'Wie opvang zoekt voor zijn (nog niet geboren) kindjes, komt best zo vroeg mogelijk langs voor een rondleiding en infogesprek.  In juni 2013 openen we 2 extra leefgroepen voor kindjes van 0 tot 3 jaar.', '<p><strong>Wie opvang zoekt voor zijn (nog niet geboren) kindjes, komt best zo vroeg mogelijk langs voor een rondleiding en infogesprek. In juni 2013 openen we 2 extra leefgroepen voor kindjes van 0 tot 3 jaar.</strong><br /> Hierdoor is onze wachtlijst een heel stuk korter geworden en hebben we nog plaatsen vrij vanaf juni 2013. Deze wachltijst is constant in beweging en (toekomstige) ouders die vroeger opvang nodig hebben, kunnen natuurlijk ook altijd een afspraak maken.</p>\r\n<p>Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus.<br /> Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi.</p>\r\n<p>Nam eget dui. Etiam rhoncus. Maecenas tempus, tellus eget condimentum rhoncus, sem quam semper libero, sit amet adipiscing sem neque sed ipsum. Nam quam nunc, blandit vel, luctus pulvinar, hendrerit id, lorem. Maecenas nec odio et ante tincidunt tempus. Donec vitae sapien ut libero venenatis faucibus. Nullam quis ante. Etiam sit amet orci eget eros faucibus tincidunt. Duis leo. Sed fringilla mauris sit amet nibh. Donec sodales sagittis magna.</p>', 'de-wachtlijst-in-cr-che-pardijntje-wordt-uitgebreid-met-28-plaatsen', '', '', '', 1),
